" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Clinical and biological features of CD3-negative NK-LGL leukemia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\" rowspan=\"1\">",
"        Clinical features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Splenomegaly",
"       </td>",
"       <td>",
"        90 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hepatomegaly",
"       </td>",
"       <td>",
"        60 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lymphadenopathy",
"       </td>",
"       <td>",
"        27 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\" rowspan=\"1\">",
"        Biologic features",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Marrow infiltration",
"       </td>",
"       <td>",
"        100 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Neutropenia",
"       </td>",
"       <td class=\"sublist_other_start\">",
"        50 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Severe neutropenia (ANC &lt;500/&micro;L)",
"       </td>",
"       <td class=\"sublist_other\">",
"        18 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anemia",
"       </td>",
"       <td>",
"        100 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Thrombocytopenia",
"       </td>",
"       <td>",
"        75 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hyperlymphocytosis (&gt;10,000/&micro;L)",
"       </td>",
"       <td>",
"        70 percent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\" colspan=\"2\" rowspan=\"1\">",
"        Rarely reported",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Gastrointestinal infiltration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Central nervous system involvement",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Ascites",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Idiopathic thrombocytopenic purpura",
"       </td>",
"      </tr>",
"      <tr>",
"       <td colspan=\"2\" rowspan=\"1\">",
"        Disseminated intravascular coagulation",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
